import { makeStyles } from '@material-ui/core/styles';


export default makeStyles(() => ({
    root: {
        background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
        border: 0,
        borderRadius: 3,
        color: 'white',
        padding: '0 50px',
    },
    paper: {
        margin: "10px",
        background: '#0021A5',
        color: 'blue'
    },
    icons: {
        color:'white',
    },
    buttons: {
        color:'#FA4616'
    },
}));
